import React from 'react'

import { Footer, Blog, Possibility, Features, Header } from './containers';

import {CTA, Brand, Navbar } from './components';

import './App.css';
const App = () => {
  return (
    <div className="App">
      <div className="gradiant__bg">
        <Navbar />
        <Header />
      </div>
      
      <Brand />
      <Features />
      <Possibility />
      <CTA />
      <Blog />
      <Footer />
    </div>
  )  
}

export default App
